/*For displaying the link to the HomePage*/
import React from "react";
import "./css/display.css";

const HomePage = () => {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" version="1.1" viewBox="0 0 600 300">
      <a href="http://littup.cc/thisforthat/api/all_api_links.html" target="_blank" rel="noopener noreferrer">
        {/*Symbol*/}

        <symbol id="s-text">
          <text textAnchor="middle" x="40%" y="50%" dy="1em" dx="-1em">
            datafox
          </text>
        </symbol>

        {/* Duplicate Symbol*/}

        <use xlinkHref="#s-text" className="text" />
        <use xlinkHref="#s-text" className="text" />
        <use xlinkHref="#s-text" className="text" />
        <use xlinkHref="#s-text" className="text" />
        <use xlinkHref="#s-text" className="text" />
      </a>
    </svg>
  );
};

export default HomePage;
